import React from "react";

function isGirl(props){
  return (
    <li className="genderFormat" key={props.id}>
      {props.name}
    </li>
  );
}

function BabyNamesList(props){
    return (
      <ul>
        {props.data.map((babyName) => (
          <isGirl props = {babyName}/>
        ))}
      </ul>
    );
}


export default BabyNamesList;
